import openModalReducer from './reducers';
import closeModalReducer from './reducers';
import updateCurrentReducer from './reducers';
import updateEntryReducer from './reducers';
import updateAppointmentReducer from './reducers';
import { combineReducers } from 'redux';

export const rootReducer = combineReducers({
  modal_open: openModalReducer,
  modal_close: closeModalReducer,
  update_current: updateCurrentReducer,
  update_entry: updateEntryReducer,
  update_appointment: updateAppointmentReducer

});

